import axios from "axios";
import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

const Favorites = () => {
  const [movie, setMovie] = useState([])
  useEffect(() => {
    axios
      .get("/api/favorites")
      .then((res) => setMovie(res.data));
  }, []);
  return (
    <>
      <Link to="/">Volver</Link>
      <div>{movie}</div>
    </>
  );
};

export default Favorites;
